export function Updaters() {
  return (
    <>
      <ListsUpdater />
      <UserUpdater />
      {/* <PoolsUpdater /> */}
      <ApplicationUpdater />
      <TransactionUpdater />
      <MulticallUpdater />
      <WalletUpdater />
      <NonevmUpdater />
      {/* <RpcUpdater /> */}
      {/* <MulticallUpdater type={1}/> */}
    </>
  )
}
